import React from "react";

const Itinerary = ({ items = [] }) => {
  return (
    <div>
      <h2>Itinerary List</h2>
      {items.length > 0 ? (
        items.map((item, index) => <p key={index}>{item.name}</p>)
      ) : (
        <p>No itinerary items available.</p>
      )}
    </div>
  );
};

export default Itinerary;
